private Double findMaximumValue(){
	Set<Pair<STATE_TYPE, ACTION_TYPE>> keys = table.keySet();
	if (keys.size() > 0) {
		Double maxValue = table.get(keys.toArray()[0]);
		for (Pair<STATE_TYPE, ACTION_TYPE> key : keys) {
			Double v = table.get(key);
			if (v > maxValue) {
