				this.mTileProvider = new OSMMapTileDownloadProvider(this.mCtx, pProviderInfo, this.mFSTileCache);
				break;
		}
	}
	this.mFSTileCache.setProviderInfo(pProviderInfo);
	this.mProviderInfo = pProviderInfo;
