/**
 * Symmetric tridiagonal QL algorithm as used in JAMA Package.
 */
private void performQLalgorithm (){

	//  This is derived from the Algol procedures tql2, by
	//  Bowdler, Martin, Reinsch, and Wilkinson, Handbook for
	//  Auto. Comp., Vol.ii-Linear Algebra, and the corresponding
	//  Fortran subroutine in EISPACK.

	for (int i = 1; i < dimension; i++) {
		e[i-1] = e[i];
	}
	e[dimension-1] = 0.0;

	double f = 0.0;
	double tst1 = 0.0;
	double eps = Math.pow(2.0,-52.0);
	for (int l = 0; l < dimension; l++) {

		// Find small subdiagonal element

		tst1 = Math.max(tst1,Math.abs(eig[l]) + Math.abs(e[l]));
		int m = l;
		while (m < dimension) {
			if (Math.abs(e[m]) <= eps*tst1) {
				break;
			}
			m++;
		}

		// If m == l, d[l] is an eigenvalue,
		// otherwise, iterate.

		if (m > l) {
			int iter = 0;
			do {
				iter = iter + 1;  // (Could check iteration count here.)

				// Compute implicit shift

				double g = eig[l];
				double p = (eig[l+1] - g) / (2.0 * e[l]);
				double r = hypot(p,1.0);
				if (p < 0) {
					r = -r;
				}
				eig[l] = e[l] / (p + r);
				eig[l+1] = e[l] * (p + r);
				double dl1 = eig[l+1];
				double h = g - eig[l];
				for (int i = l+2; i < dimension; i++) {
					eig[i] -= h;
				}
				f = f + h;

				// Implicit QL transformation.

				p = eig[m];
				double c = 1.0;
				double c2 = c;
				double c3 = c;
				double el1 = e[l+1];
				double s = 0.0;
				double s2 = 0.0;
				for (int i = m-1; i >= l; i--) {
					c3 = c2;
					c2 = c;
					s2 = s;
					g = c * e[i];
					h = c * p;
					r = hypot(p,e[i]);
					e[i+1] = s * r;
					s = e[i] / r;
					c = p / r;
					p = c * eig[i] - s * g;
					eig[i+1] = h + s * (c * g + s * eig[i]);

					// Accumulate transformation.

					for (int k = 0; k < dimension; k++) {
						h = smallMatrix[k][i+1];
						smallMatrix[k][i+1] = s * smallMatrix[k][i] + c * h;
						smallMatrix[k][i] = c * smallMatrix[k][i] - s * h;
					}
				}
				p = -s * s2 * c3 * el1 * e[l] / dl1;
				e[l] = s * p;
				eig[l] = c * p;

				// Check for convergence.

			} while (Math.abs(e[l]) > eps*tst1);
		}
		eig[l] = eig[l] + f;
		e[l] = 0.0;
	}

	// Sort eigenvalues and corresponding vectors.

	for (int i = 0; i < dimension-1; i++) {
		int k = i;
		double p = eig[i];
		for (int j = i+1; j < dimension; j++) {
			if (eig[j] < p) {
				k = j;
				p = eig[j];
			}
		}
		if (k != i) {
			eig[k] = eig[i];
			eig[i] = p;
			for (int j = 0; j < dimension; j++) {
				p = smallMatrix[j][i];
				smallMatrix[j][i] = smallMatrix[j][k];
				smallMatrix[j][k] = p;
			}
		}
	}
},"/**

