@Override
public void run(){

	String answer="";
	Smash.getFrames()[0].setCursor(new Cursor(Cursor.WAIT_CURSOR));

	for(ImageFile imf : list){
		if(!imf.isSent()){
			imf.setSending();
			model.fireTableDataChanged();
			setup("users/"+id+"/upshots.xml");
			answer = sendData(imf);
			if(!answer.isEmpty())
				imf.setSent();
			model.fireTableDataChanged();
		}
	}
	Smash.getFrames()[0].setCursor(new Cursor(Cursor.DEFAULT_CURSOR));
},"/**

/**
 * Simple get request to retrieve informations from
 * setted up host
 * @return A code value for what happened : <br />
 *  0 : getUser() and/or setup() not yet called<br />
 *  c : ok<br />
 * -1 : login failed<br />
 */
public int getId(){
	if(logged & ready){
		try {
			connection.setRequestMethod("GET");
			isr = new InputStreamReader(connection.getInputStream());
			int c = 0;

			c = isr.read();
			String s = new String();
			while(c!=-1){
				s += (char)c;
				c = isr.read();
			}
			isr.close();
			id=Integer.parseInt(s);
			return Integer.parseInt(s);
		} catch (IOException e) {
			return -1;
		} 
		finally{
			connection.disconnect();
		}
	}
	return 0;
},"/**

