// skips whitespace until next token
private int readNext() throws IOException{
	boolean ws;
	int next;
	do {
		next = in.read();
		switch (next) {
		case '\r':
			next = in.read();
			if ((next != '\n') && (next > 0)) {
				in.unread(next);
			}
			// fallthrough
		case '\n':
			lineNo++;
			ws = true;
			break;
		case '\000':
		case '\b':
		case '\t':
		case '\f':
		case ' ':
			ws = true;
			break;
		default:
			ws = false;
		}
	} while ((next != -1) && ws);

	return (ws) ? -1 : next;
},"// skips whitespace until next token

